import React from "react";
import {
  Button,
  Card,
  CardActionArea,
  CardActions,
  CardContent,
  CardMedia,
  Typography,
} from "@material-ui/core";

function MovieSingle(props) {
  return (
    <div>
      <a>
        <div
          style={{
            backgroundImage: `url(${props.data.hinhAnh})`,
            position: "relative",
            borderRadius: "4px",
            backgroundPosition: "center center",
            backgroundSize: "100% auto",
            backgroundRepeat: "no-repeat",
            display: "block",
            marginBottom: "10px",
            height: "400px",
          }}
        ></div>

        <div>
          <div>
            <Typography>{props.data.tenPhim}</Typography>
          </div>
          <div>
            <Typography>{props.data.moTa}</Typography>
          </div>
        </div>
      </a>
    </div>
  );
}

export default MovieSingle;
